#include <iostream>
#include <Windows.h>
#include <wincrypt.h>
#include <string>
#include <iomanip>
#include <iostream>

using namespace std;

int main()
{
    setlocale(LC_ALL, "RUS");

    string pass;
    cout << " : ";
    cin >> pass;

    string line;
    cout << "   : ";
    cin >> line;

    HCRYPTPROV hProv;
    HCRYPTHASH hHash;
    HCRYPTKEY hKey;

    if (!CryptAcquireContext(&hProv, NULL, NULL, PROV_RSA_FULL, 0))
    {
        cerr << "  : " << GetLastError();
    }

    if (!CryptCreateHash(hProv, CALG_SHA, 0, 0, &hHash))
    {
        cerr << "-  : " << GetLastError();
        CryptReleaseContext(hProv, 0);
    }

    LPCSTR pbPass = pass.c_str();
    if (!CryptHashData(hHash, (BYTE*)pbPass, pass.size(), 0))
    {
        cerr << " : " << GetLastError();
    }

    if (!CryptDeriveKey(hProv, CALG_3DES, hHash, 0, &hKey))
    {
        cerr << "   : " << GetLastError();
    }

     
    LPCSTR pbData = line.c_str();
    DWORD pdwDataLen = line.size();
    DWORD dwBufLen = pdwDataLen + 8;
    if (!CryptEncrypt(hKey, 0, TRUE, 0, (BYTE*)pbData, &pdwDataLen, dwBufLen))
    {
        cerr << " : " << GetLastError();
    }

    cout << " : " << string(pbData, pdwDataLen) << endl;

    if (!CryptDecrypt(hKey, 0, TRUE, 0, (BYTE*)pbData, &pdwDataLen))
    {
        cerr << " : " << GetLastError();
    }

    cout << " : " << string(pbData, pdwDataLen) << endl;

    CryptDestroyHash(hHash);
    CryptDestroyKey(hKey);
    CryptReleaseContext(hProv, 0);
    return 0;
}

